function downloadFile(name, src, type) {
  if (isImageInChromeNotEdge(type)) {
    // 判断是否为chrome里的图片
    ImgtodataURL(src, name, type);
  } else {
    downloadNormalFile(src, name);
  }
}

function isImageInChromeNotEdge(fType) {
  var bool = false;
  if (window.navigator.userAgent.indexOf('Chrome') !== -1 && window.navigator.userAgent.indexOf('Edge') === -1) {
    if (fType === 'jpg' || fType === 'gif' || fType === 'png' || fType === 'bmp' || fType === 'jpeg' || fType === 'svg') {
      bool = true;
    }
  }
  return bool;
}

function downloadNormalFile(src, filename) {
  var link = document.createElement('a');
  link.setAttribute('download', filename);
  link.href = src;
  document.body.appendChild(link); // 添加到页面中，为兼容Firefox浏览器
  link.click();
  document.body.removeChild(link); // 从页面移除
}

function ImgtodataURL(url, filename, fileType) {
  getBase64(url, fileType, function (_baseUrl) {
    // 创建隐藏的可下载链接
    var eleLink = document.createElement('a');
    eleLink.download = filename;
    eleLink.style.display = 'none';
    // 图片转base64地址
    eleLink.href = _baseUrl;
    // 触发点击
    document.body.appendChild(eleLink);
    eleLink.click();
    // 然后移除
    document.body.removeChild(eleLink);
  });
}

function getBase64(url, fileType, callback) {
  // 通过构造函数来创建的 img 实例，在赋予 src 值后就会立刻下载图片
  var Img = new Image();
  var dataURL = '';
  Img.src = url;
  Img.setAttribute('crossOrigin', 'anonymous');
  Img.onload = function () {
    // 要先确保图片完整获取到，这是个异步事件
    var canvas = document.createElement('canvas'); // 创建canvas元素
    var width = Img.width; // 确保canvas的尺寸和图片一样
    var height = Img.height;
    canvas.width = width;
    canvas.height = height;
    canvas.getContext('2d').drawImage(Img, 0, 0, width, height); // 将图片绘制到canvas中
    dataURL = canvas.toDataURL(); // 转换图片为dataURL
    callback ? callback(dataURL) : null;
  };
}

